import React ,{Component} from 'react';
import {Row,Col, Container} from 'react-bootstrap';
import Header from '../header/Header';
import YouTube from 'react-youtube';
import Carousel from 'react-bootstrap/Carousel'
import './Home.css';
class Home extends Component{
render(){
  const opts = {
    height: '390',
    width: '640',
    playerVars: {
      // https://developers.google.com/youtube/player_parameters
      autoplay: 1,
    },
  };

    return(
<div>
    <Header />  
<section className="section_img">
<Carousel className="Carousel-RMK">
  <Carousel.Item>
    <img
      className="d-block RMK-img"
      src={require('../Images/15.jpg')}
      alt="First slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block RMK-img "
      src={require('../Images/3_0.jpg')}
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block RMK-img"
      src={require('../Images/4.jpg')}
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>
    </section>
    <section className="section-video">
    <Row>
    <Col>
      <h1>Mission</h1>
      <h2></h2>
    </Col>
    <Col>  <YouTube videoId="mNKbcp8dmiQ" opts={opts} onReady={this._onReady} /></Col>
  
</Row>

    </section>
    </div>
    );
    }
    _onReady(event) {
      // access to player in all event handlers via event.target
      event.target.pauseVideo();
}


}
export default Home;
